import styled from 'styled-components';

export const Container = styled.div`
    position: relative;
    padding: 40px 0;
    background: linear-gradient(
        108deg,
        rgba(11, 83, 69 ) 0%,
        rgba(23, 165, 137) 100%
    );
`

export const Wrap = styled.div`
position: absolute; 
top: 0;             
bottom: 0;           
left: 0;        
right: 0;
margin: auto; 
`
